import React, { useState } from 'react';

const Search = () => {
    const [img, setimg] = useState("");
    const inputEvent = (event) =>{
         const data = event.target.value;
         console.log(data);
         setimg(data);
    }
    return (
        <>
            <div className='search_bar'>

                <input type='text' 
                onChange={inputEvent}
                placeholder="serch anything" 
                value={img}
                 />

            </div>

        </>
    )
}

export default Search;
